import React from "react";
import { Button, Box, TextField, Stack, Container } from "@mui/material";
import "./index.css";

function Login() {
  return (
      <Container alignContent="center">
     <Stack spacing={3}
     >
          <TextField
            fullWidth
            id="outlined-basic"
            label="Username"
            variant="outlined"
          />
          <TextField
            fullWidth
            id="outlined-password-input"
            label="Password"
            type="password"
          />
          <Button fullWidth variant="contained">
            Login
          </Button>
    </Stack>
    </Container>
  );
}

export default Login;
